import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { UgandaPlacesComponent } from './uganda-places/uganda-places.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { UgandaPlaceDetailComponent } from './uganda-place-detail/uganda-place-detail.component';

const routes: Routes = [
  {path: 'api/ugandaplaces', component: UgandaPlacesComponent},
  {path: 'api/dashboard', component: DashboardComponent},
  {path: 'api/detail/:id', component: UgandaPlaceDetailComponent},
  {path: '', redirectTo: '/dashboard', pathMatch: 'full'},
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
